import React from 'react';

//deconstructing 두 번
const VideoItem = ({video: {snippet}}) => (<li>


  <img src={snippet.thumbnails.medium.url}
  alt="video thumbnail" />

  <div>
    <p>
      {snippet.title}
    </p>
    <p>
      {snippet.chanelTitle}
    </p>
  </div>
</li>
)
export default VideoItem;
